import React, {useRef} from 'react';
import {  Link } from "react-router-dom";
const Navbar = () => {
    const userName = useRef();
    const  passwordUser = useRef();
    const SaveUser = () => {
        const user = userName.current.input.value;
        const passwordU = passwordUser.current.input.value;
        if (user !== '' && passwordU !== '') {
            // props.setNameUser(user);
            console.log(user);
            userName.current.value = null;
        }
      };
  return (
  <div className='nav'>
      <ul className='navbar'>
    <li>
      <Link className='home' to="/">Home </Link>
      <Link className='list' to="/list"> List </Link>
         <input  type='text' className='input' placeholder='user name'></input>
         <input  type='text' className='input' placeholder='password'></input>
         <button className='input' onClick={SaveUser}>Login</button>
    </li>
    </ul>
  </div>
  );
}
export default Navbar;
